import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
      <header className="globalheader">
        <div className="logo">
				<a href="https://acclaimedhw.com">
        <img src={logo} alt="logo" />
				</a>
			</div>
      </header>
      </div>
    </div>

  );
}

export default App;
